mapper.select:

select 

from PreName
where ChineseName = #{chineseName,jdbcType=VARCHAR}
  and FirstReceiveNo = #{firstReceiveNo,jdbcType=VARCHAR}

mapper.delete:

delete from PreName
where ChineseName = #{chineseName,jdbcType=VARCHAR}
  and FirstReceiveNo = #{firstReceiveNo,jdbcType=VARCHAR}

mapper.insert:

insert into PreName (ChineseName, FirstReceiveNo, ChangeDate, 
  LastUpdateTime, MaintainHost, Reserved, 
  Version, DeleteFlag, CreateBy
  )
values (#{chineseName,jdbcType=VARCHAR}, #{firstReceiveNo,jdbcType=VARCHAR}, #{changeDate,jdbcType=VARCHAR}, 
  #{lastUpdateTime,jdbcType=TIMESTAMP}, #{maintainHost,jdbcType=VARCHAR}, #{reserved,jdbcType=VARCHAR}, 
  #{version,jdbcType=NUMERIC}, #{deleteFlag,jdbcType=VARCHAR}, #{createBy,jdbcType=VARCHAR}
  )

mapper.update:

update PreName
set ChangeDate = #{changeDate,jdbcType=VARCHAR},
  LastUpdateTime = #{lastUpdateTime,jdbcType=TIMESTAMP},
  MaintainHost = #{maintainHost,jdbcType=VARCHAR},
  Reserved = #{reserved,jdbcType=VARCHAR},
  Version = #{version,jdbcType=NUMERIC},
  DeleteFlag = #{deleteFlag,jdbcType=VARCHAR},
  CreateBy = #{createBy,jdbcType=VARCHAR}
where ChineseName = #{chineseName,jdbcType=VARCHAR}
  and FirstReceiveNo = #{firstReceiveNo,jdbcType=VARCHAR}
